import React, { Component } from 'react'

import PlaceImg from './../assets/ic_place.svg';
import StoreImg from './../assets/ic_store.svg';

import './../styles/outletCard.css'

export class OutletCard extends Component {
    render() {
        return (
            <div className="card card--biponon">
                <div className="card-heading--biponon">+8807123456789</div>
                <div className="card-body--biponon">
                    <p className="name"><img src={StoreImg} alt="outlet name" /> Meena Bazar</p>
                    <p className="address"><img src={PlaceImg} alt="address" /> Meena House, 719/A Satmosjid Road, Dhanmondi</p>
                </div>
                <hr />
                <div className="card-footer--biponon">
                    <div className="circle"></div>SME
                </div>
            </div>
        )
    }
}

export default OutletCard
